  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	title: 'metadata服务'
};
export const metadata = {
  "id": "rancher1/rancher-service/metadata-service/_index",
  "title": "metadata服务",
  "description": "Rancher 通过基础设施中的 Metadata 服务为服务和容器提供数据。这些数据用来管理运行中的 docker 实例。这些数据可以通过调用基于 HTTP 的 API 来访问。这些数据包括创建容器，服务时的静态数据，也包括运行时数据，例如:在同一个服务里的其他容器的相关信息。",
  "source": "@site/docs/rancher1/rancher-service/metadata-service/_index.md",
  "permalink": "/docs/rancher1/rancher-service/metadata-service/_index",
  "editUrl": "https://github.com/cnrancher/docs-rancher2/edit/master/docs/rancher1/rancher-service/metadata-service/_index.md",
  "lastUpdatedBy": "Author",
  "lastUpdatedAt": 1539502055,
  "sidebar": "rancher1",
  "previous": {
    "title": "负载均衡",
    "permalink": "/docs/rancher1/rancher-service/load-balancer/_index"
  },
  "next": {
    "title": "网络策略",
    "permalink": "/docs/rancher1/rancher-service/network-policy/_index"
  }
};
  /* @jsx mdx */

export const rightToc = [{
  value: '如何获取 Metadata',
  id: '如何获取-metadata',
  children: []
}, {
  value: 'Metadata 的版本',
  id: 'metadata-的版本',
  children: []
}, {
  value: '纯文本 vs JSON',
  id: '纯文本-vs-json',
  children: []
}, {
  value: 'Metadata 属性',
  id: 'metadata-属性',
  children: []
}, {
  value: '为服务添加用户自定义 Metadata',
  id: '为服务添加用户自定义-metadata',
  children: []
}];
const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`Rancher 通过基础设施中的 Metadata 服务为服务和容器提供数据。这些数据用来管理运行中的 docker 实例。这些数据可以通过调用基于 HTTP 的 API 来访问。这些数据包括创建容器，服务时的静态数据，也包括运行时数据，例如:在同一个服务里的其他容器的相关信息。`}</p>
    <p>{`通过 Rancher 的 Metadata 服务，您可以进到任何使用 Rancher 托管网络的容器的命令行中，并查看运行在 Rancher 中的容器的信息。通过 Metadata 服务您可以获取容器，服务，容器所在的应用，容器所在的主机。Metadata 是 JSON 格式的。`}</p>
    <p>{`有多种方式可以将容器运行在 Rancher 托管网络中。Rancher 网络的原理详见`}<a parentName="p" {...{
        "href": "/docs/rancher1/rancher-service/networking/_index"
      }}>{`网络相关文档`}</a>{`。`}</p>
    <h3 {...{
      "id": "如何获取-metadata"
    }}>{`如何获取 Metadata`}</h3>
    <p>{`通过 Rancher UI，您可以通过容器的下拉菜单的`}<strong parentName="p">{`执行命令行`}</strong>{`进入运行命令界面。在鼠标悬停在容器上时，会显示容器名和右侧的下拉菜单。`}</p>
    <p>{`您可以通过 curl 命令获取 metadata 信息。`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`# If curl is not installed, install it
$ apt-get install curl
# Basic curl command to obtain a plaintext response
$ curl http://rancher-metadata/<version>/<path>
`}</code></pre>
    <p>{`curl 请求的路径取决于您想要获取的 metadata 信息和格式。`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Metadata`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`路径`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`容器`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`self/container`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`提供运行命令的容器的 metadata 信息`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`容器所在服务`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`self/service`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`提供运行命令的容器对应服务的 metadata 信息`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`容器所在应用`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`self/stack`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`提供运行命令的容器对应应用的 metadata 信息`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`容器所在主机`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`self/host`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`提供运行命令的容器对应主机的 metadata 信息`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`其他容器`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`containers`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`提供所有容器的 metadata 信息。在纯文本格式时，提供了带上索引序号的所有容器。在 JSON 格式，提供了所有容器的所有 metadata 信息。使用序号或者名字。都可以获取指定容器的 metadata 信息。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`其他服务`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`services`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`提供了所有服务的 metadata 信息。在纯文本格式时，提供了带上索引序号的所有服务。在 JSON 格式，提供了所有服务的所有 metadata 信息。在路径中使用序号或者名字，都可以获取指定服务的 metadata 信息。当访问容器详细信息时，在 V1 (`}<inlineCode parentName="td">{`2015-07-25`}</inlineCode>{`)只返回容器名称，但是在 V2 (`}<inlineCode parentName="td">{`2015-12-19`}</inlineCode>{`)，容器实例也会返回。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`其他应用`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`stacks/<stack-name>`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`提供了所有应用的 metadata 信息。在纯文本格式，提供了带上索引序号的所有应用。在 JSON 格式，提供了所有应用的所有 metadata 信息。使用序号或者名字。都可以获取指定容器的 metadata 信息。在路径中使用序号或者名字，都可以获取指定应用的 metadata 信息。当访问 container 详细信息时，在 V1 (`}<inlineCode parentName="td">{`2015-07-25`}</inlineCode>{`)只返回容器名称，但是在 V2 (`}<inlineCode parentName="td">{`2015-12-19`}</inlineCode>{`)，容器实例也会返回。`}</td>
        </tr>
      </tbody>
    </table>
    <h3 {...{
      "id": "metadata-的版本"
    }}>{`Metadata 的版本`}</h3>
    <p>{`在`}<inlineCode parentName="p">{`curl`}</inlineCode>{`命令中，我们强烈建议使用确定的版本号，但是您也可以选者`}<inlineCode parentName="p">{`latest`}</inlineCode>{`。`}</p>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p">{`注意:`}</strong>{` 因为`}<inlineCode parentName="p">{`latest`}</inlineCode>{`版本会包含最新的代码变动，各个版本的返回的数据可能不同，需要确认是否和您之前的代码能够兼容。`}</p>
    </blockquote>
    <p>{`metadata 的版本是基于日期的。`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Version Reference`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Version`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`V2`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`2015-12-19`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`V1`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`2015-07-25`}</td>
        </tr>
      </tbody>
    </table>
    <h4 {...{
      "id": "版本变化"
    }}>{`版本变化`}</h4>
    <h5 {...{
      "id": "v1-vs-v2"
    }}>{`V1 vs. V2`}</h5>
    <p>{`当通过 http 请求访问路径 `}<inlineCode parentName="p">{`/services/<service-name>/containers`}</inlineCode>{`或者`}<inlineCode parentName="p">{`/stacks/<stack-name>/services/<service-name>/containers`}</inlineCode>{`时, V1 返回容器名称，V2 返回容器实例。更多详细信息在 V2 metadata 服务中提供。`}</p>
    <h5 {...{
      "id": "范例"
    }}>{`范例`}</h5>
    <p>{`在 Rancher 中，名为`}<inlineCode parentName="p">{`foostack`}</inlineCode>{`的应用包含一个有三个容器的服务 `}<inlineCode parentName="p">{`barservice`}</inlineCode>{`。`}</p>
    <pre><code parentName="pre" {...{}}>{`# 在V1只返回service的container names
$ curl --header 'Accept: application/json' 'http://rancher-metadata/2015-07-25/services/barservice/containers'
["foostack_barservice_1", "foostack_barservice_2", "foostack_barservice_1"]

# 在V2中返回service的container objects
$ curl --header 'Accept: application/json' 'http://rancher-metadata/2015-12-19/services/barservice/containers'
[{"create_index":1, "health_state":null,"host_uuid":...
...
# 获取service中所有容器的metadata信息
...
...}]

# 在V2，可以获取指定的container object
$ curl --header 'Accept: application/json' 'http://rancher-metadata/2015-12-19/services/barservice/containers/foostack_barservice_1'
[{"create_index":1, "health_state":null,"host_uuid":...
...
# 获取service中所有容器的metadata信息
...
...}]

# 通过路径 /stacks/<service-name>，可以访问services和containers

# 使用V1只返回service的container names
$ curl --header 'Accept: application/json' 'http://rancher-metadata/2015-07-25/stacks/foostack/services/barservice/containers'
["foostack_barservice_1", "foostack_barservice_2", "foostack_barservice_1"]

# 使用V2返回service的container objects
$ curl --header 'Accept: application/json' 'http://rancher-metadata/2015-12-19/stacks/foostack/services/barservice/containers'
[{"create_index":1, "health_state":null,"host_uuid":...
...
# 获取service中所有容器的metadata信息
...
...}]
`}</code></pre>
    <h3 {...{
      "id": "纯文本-vs-json"
    }}>{`纯文本 vs JSON`}</h3>
    <p>{`Metadata 返回有纯文本和 JSON 两种格式，根据需要选择相应格式.`}</p>
    <h4 {...{
      "id": "纯文本"
    }}>{`纯文本`}</h4>
    <p>{`通过 curl 命令，会获得请求路径的纯文本格式返回。您可以通过从第一层路径开始，层层推进，找到您需要的信息。`}</p>
    <pre><code parentName="pre" {...{}}>{`$ curl 'http://rancher-metadata/2015-12-19/self/container'
create_index
dns/
dns_search/
external_id
health_check_hosts/
health_state
host_uuid
hostname
ips/
labels/
memory_reservation
milli_cpu_reservation
name
network_from_container_uuid
network_uuid
ports/
primary_ip
primary_mac_address
service_index
service_name
stack_name
stack_uuid
start_count
state
system
uuid
$ curl 'http://rancher-metadata/2015-12-19/self/container/name'
# Note: Curl 不会返回新的行，只有一个数据时返回会输出在同一行
Default_Example_1$root@<container_id>
$ curl 'http://rancher-metadata/2015-12-19/self/container/label/io.rancher.stack.name'
Default$root@<container_id>
# Arrays可以通过序号或者名字访问
$ curl 'http://rancher-metadata/2015-12-19/services'
0=Example
# 使用序号或者名字
$ curl 'http://rancher-metadata/2015-12-19/services/0'
$ curl 'http://rancher-metadata/2015-12-19/services/Example'
`}</code></pre>
    <h4 {...{
      "id": "json"
    }}>{`JSON`}</h4>
    <p>{`JSON 格式的返回可以通过在 curl 命令中增加 header `}<inlineCode parentName="p">{`Accept: application/json`}</inlineCode></p>
    <pre><code parentName="pre" {...{}}>{`$ curl --header 'Accept: application/json' 'http://rancher-metadata/2015-12-19/self/container'
$ curl --header 'Accept: application/json' 'http://rancher-metadata/2015-12-19/self/stack'
# 获取stack中另一个service的信息
$ curl --header 'Accept: application/json' 'http://rancher-metadata/2015-12-19/services/<service-name>'
`}</code></pre>
    <h3 {...{
      "id": "metadata-属性"
    }}>{`Metadata 属性`}</h3>
    <h4 {...{
      "id": "容器"
    }}>{`容器`}</h4>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`属性`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`create_index`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`容器启动的序号 例如 2 代表的是服务中启动的第二个容器。注意: Create_index 不会被重用。 如果您的服务包含两个容器，删除了第二个容器，下一个启动的容器的`}<inlineCode parentName="td">{`create_index`}</inlineCode>{`会是 3，即使服务中只包含 2 个容器`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`dns`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`容器的 DNS 服务器。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`dns_search`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`容器的搜索域。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`external_id`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`在主机上的 Docker 容器 ID。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`health_check_hosts`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`列出运行健康检查的主机的的 UUIDs。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`health_state`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`开启健康检查的容器的健康状态 `}<a parentName="td" {...{
              "href": "/docs/rancher1/infrastructure/cattle/health-checks/_index"
            }}>{`健康检查`}</a>{`。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`host_uuid`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Rancher Server 分配给主机的唯一标识。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`hostname`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`容器的 hostname。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`ips`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`支持多 NIC 时的 IP 列表`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`labels`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "/docs/rancher1/infrastructure/cattle/scheduling/_index#labels"
            }}>{`容器标签`}</a>{`列表。格式为`}<inlineCode parentName="td">{`key`}</inlineCode>{`:`}<inlineCode parentName="td">{`value`}</inlineCode>{`。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`memory_reservation`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`容器可以使用内存的软限制。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`milli_cpu_reservation`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`容器可以使用 CPU 的软限制，值为正整数，1 代表 1/1000CPU。所以，1000 代表 1 个 CPU，500 代表半个 CPU。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`name`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`容器的名字。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`network_from_container_uuid`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`容器网络来源的容器 UUID。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`network_uuid`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Rancher 分配的网络唯一标识`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`ports`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`列出`}<a parentName="td" {...{
              "href": "/docs/rancher1/infrastructure/cattle/adding-services/_index#port-mapping"
            }}>{`容器使用的端口`}</a>{`。格式为: `}<inlineCode parentName="td">{`hostIP:publicIP:privateIP[/protocol]`}</inlineCode>{`.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`primary_ip`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`容器 IP`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`primary_mac_address`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`容器的 MAC 地址`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`service_index`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`服务中容器名称的最后一个数字`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`service_name`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`服务名称(如果存在)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`stack_name`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`服务所在的应用的名称(如果存在)`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`stack_uuid`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Rancher 分配的应用的唯一标识`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`start_count`}</inlineCode></td>
